import React from "react";

const Login = () => {
    return (
        <div>
            <h2>로그인</h2>
            <form>
                <div>
                    <label>계정: </label>
                    <input type="text"/>
                </div>
                <div>
                    <label>비밀번호: </label>
                    <input type="password"/>
                </div>
                <button type="submit"></button>
            </form>
        </div>
    )
}

export default Login;
